import React from 'react'
import Navbar from '../../components/Navbar';
import { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import MiniTicket from './MiniTicket';

function ProjectDetails({user}) {
  let navigate = useNavigate()
  let params = useParams()

  const [tick, setTick] = useState([])
  const [proj, setProj] = useState({})

useEffect(() => {
   fetch(`/project/alltickets/${params.id}`)
   .then(res => res.json())
   .then(data => {
     console.log(data);
    setTick(data.tickets)
    setProj(data)
   })
}, [])

console.log();


  return (
    <div className='conatiner'>
      <Navbar />
      <div class="card w-50 mx-auto ">
        <div class="card-header">
          Project Details
         </div>
            <div class="card-body">
              <h5 class="card-title"></h5>
              <p class="card-text"><strong>Name: </strong>{proj.title}</p>
              <p><strong>Description: </strong>{proj.description}</p>
              <a href="#" class="btn btn-primary btn-sm mt-3 ">Edit</a>
         </div>
      </div>
      <div  class="container py-5 h-100 border mt-5">
        <div>
          <div class="card mb-5" style={{width: 400}}>
  <div class="card-header">
    Featured
  </div>
  <ul class="list-group list-group-flush">
    <li class="list-group-item">Cras justo odio</li>
    <li class="list-group-item">Dapibus ac facilisis in</li>
    <li class="list-group-item">Vestibulum at eros</li>
  </ul>
</div>
        </div>
          <div class="row d-flex justify-content-center align-items-center h-100">
              <div class="col col-xl-10 row ">
                {proj.tickets?.map(ticket => 
                  <MiniTicket key={ticket.id} ticket={ticket}/>)}
              </div>
          </div>
      </div>

    </div>
  )
}

export default ProjectDetails
